import React from 'react';
import './footer.css'
import {Container} from "reactstrap";

const Footer = () => {
    return (
        <div className='footer'>
            <div>
                <img src="./images/Ellipse%20(3).png" alt="" className='ccc-18'/>
                <img src="./images/Ellipse%20(4).png" alt="" className='ccc-19'/>
            </div>
            <div className='text-white position-relative ccc-16'>
                <h6 className='m-5'>Услуги</h6>
                <h6 className='m-5'>Как мы работаем</h6>
                <h6 className='m-5'>Результат</h6>
                <h6 className='m-5'>Заказать</h6>
            </div>

        </div>
    );
};

export default Footer;
